export default (function(a,b,c,d){return {data:{"1MwremyNQu":{data:{id:1741,attributes:{imdbId:"tt0064526",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNjE0MDVhZDAtYTBlMS00N2U4LWEyYjEtMWUwYTA0YjllYTM1L2ltYWdlXkEyXkFqcGdeQXVyMDM0NzcxMQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"5.6\u002F10"}],item_lang:{data:{id:2404,attributes:{title:c,plot:"In Alexandria, in 1938, Darley (Michael York, a young British schoolmaster and poet, makes friends through Pursewarden (Sir Dirk Bogarde), the British Consular Officer, with Justine (Anouk Aim√©e), the beautiful and mysterious wife of a Coptic banker. He observes the affairs of her heart and incidentally discovers that she is involved in a plot against the British, meant to arm the Jewish underground in Palestine. The plot finally fails, Justine is sent to jail, and Darley decides to return to England.",slug:"justine"}}},books:{data:[{id:8935,attributes:{title:c,description:"On the eve of World War II in the Egyptian city of Alexandria, an exiled Irish schoolteacher becomes involved with Justine, the Jewish wife of a Coptic Christian.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=WlKqAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:true,published:"2011-05-31",publisher:"Penguin Books",subtitle:"A Novel (Penguin Ink)"}},{id:8936,attributes:{title:c,description:"On the eve of World War II in the Egyptian city of Alexandria, an exiled Irish schoolteacher becomes involved with Justine, the Jewish wife of a Coptic Christian",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=zuK-PBDV50QC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"1991-01-01",publisher:"Penguin Group USA",subtitle:b}},{id:8937,attributes:{title:c,description:"'I have been thinking about the girl I met last night in the mirror: dark on the marble-ivory white: glossy black hair: deep suspiring eyes in which one's glances sink because they are nervous, curious, turned to sexual curiosity.' The tragic story of the mysterious and fascinating Justine, and those whose lives she touched in pre-war Alexandria, is told by her lover, an impoverished Irish teacher who has sought refuge across the Mediterranean in Greece. It is undoubtedly a love-story, but the real heroine of the book is its setting: Alexandria, the city 'which decrees that its women shall be the voluptuaries not of pleasure but of pain'.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=D7JFPgAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:d,published:"2000-01-01",publisher:"Faber & Faber Limited",subtitle:b}},{id:8938,attributes:{title:a,description:"He answers specific questions about most of his writings and indicates what he reconstructs as his intent in writing them.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=8lbL0NYdKP4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:d,published:"1998-01-01",publisher:"Fairleigh Dickinson Univ Press",subtitle:"Conversations"}},{id:8939,attributes:{title:"The Alexandria Quartet",description:b,thumbnail:b,authors:[a],firstBook:d,published:"1960-01-01",publisher:b,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940961588}}("Lawrence Durrell","","Justine",null))